import { useEffect } from "react"




export default function GetUsers() {
    const [users, setUsers] = useState([])
    useEffect(()=>{
        axios.get('http://localhost:3000/getUsers')
        .then(users=> setUsers(users.data))
        
    })

    return(
        <div>
        <h1>Coming soon</h1>
        <h2>WOW</h2>
        </div>
    )
}
